 :\r\nFree Update All Module.\r\nSupport teknisi selama jam kerja  (08.00  17.00) atau by call.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nRequirement :\r\n	OPEN Modul Dicom Send di Modality yang akan dikoneksikan.\r\n	OPEN Modul Dicom Worklist di Modality yang akan dikoneksikan.(Untuk Query RIS)\r\n	Koneksi Jaringan pada Modality yang tersedia sudah terhubung ke jaringan RS.\r\n	IP Public dan Jaringan Internet memadai jika ingin TELERADIOLOGY(Minimal 20 Mbps Dedicated).\r\n', '1000', 'modality', 'Non E-Catalogue', '2020-01-10 10:19:00', '2021-01-21 10:34:32');
