INSERT INTO `modalities` VALUES ('56', 'RIS-SYSTEM', 'RIS-SYSTEM', 'RIS', 'INTIWID', '300000000', 'Mini RIS intiwid \r\nHarga jual net 150.000.000,-  .\r\n\r\nSpesifikasi Hardware:\r\n1 Unit Server , 1 TB Storage , 8GB RAM , Intel Xeon 6 core.\r\n1 Unit monitor server .\r\n1 Unit UPS 1300 VA.\r\n1 Unit Switch 8 port 100/1000.\r\n\r\nSpesifikasi software :\r\n1 MPPS Dicom Worklist module (Max Modality client = 6 unit).\r\n1 Webserver module.\r\n1 Template report module.\r\n1 Mini Dicom Server Engine module for CR, DR (untuk 2 Modalitas Xray Ringan) diluar CT,MR,Cathlab.\r\n1 Mini RIS Module (Registration, Search , Worklist Data, Patient Data , Modality Data, Template Dokter Radiology(MAX 100/Dokter)).\r\n\r\n\r\nGuarantee : 1 Year\r\n\r\n\r\nExt module: Bridging SIRS +Rp.50.000.000,-.\r\nExt module : Modification WebTemplate (by Hospital needed) + Rp.50.000.000,-.\r\n\r\n\r\nHarga Bridging SIRS sudah termasuk :\r\n	Biaya teknisi ( 14 hari kerja).\r\n	Biaya uji fungsi .\r\n	Training .\r\n	Garansi 1 Tahun.\r\n\r\nHarga Modification Web Template (by Hospital needed) sudah termasuk :\r\n	Biaya teknisi ( 14 hari kerja).\r\n	Biaya uji fungsi .\r\n	Training .\r\n	Garansi 1 Tahun.\r\n\r\nAfter Sales :\r\nRemote Online : Rp 40.000.000,- per tahun (exclude tax).\r\nHarga After Sales sudah termasuk :\r\nFree Update engine MPPS Worklist ,Free Update engine mini DICOM.\r\nSupport teknisi selama jam kerja  (08.00  17.00) atau by call.\r\n\r\n\r\nRequirement :\r\n	OPEN Modul Dicom Send di Modality yang akan dikoneksikan.\r\n	OPEN Modul Dicom Worklist di Modality yang akan dikoneksikan.(Untuk Query RIS)\r\n	Koneksi Jaringan pada Modality yang tersedia sudah terhubung ke jaringan RS.\r\n	IP Public dan Jaringan Internet memadai jika ingin TELERADIOLOGY(Minimal 20 Mbps Dedicated).\r\n	PC atau Laptop untuk baca Dokter Min Spek (i5 Gen 8,Ram 8GB).\r\n', '100', 'modality', 'Non E-Catalogue', '2020-08-06 09:51:53', '2021-01-21 10:34:32');
INSERT INTO `modalities` VALUES ('57', 'Medical Printer DRYSTAR 5503', 'Medical-Printer-DRYSTAR-5503', 'DRYSTAR 5503', 'AGFA', '120000000', 'GENERAL\r\nPower requirements\r\n Auto ranging 100  240 V: 50/60 Hz\r\nPower consumption\r\n Average: 450 Watt\r\n Peak: 700 Watt\r\n Standby: 200 Watt\r\nMedia supply trays\r\n All three trays configurable for 100 sheets of\r\n8 x 10 inch, 10 x 12 inch, 11 x 14 inch,\r\n14 x 14 inch or 14 x 17 inch film\r\nOperating conditions\r\n Temperature: 15 - 30 C (59 - 86 F)\r\n Humidity: 20 - 75% RH, non-condensing\r\nStorage/Shipping conditions\r\n Temperature: -25 to +55 C (-11 to 131 F)\r\n-40 to +70 C for transport (-40 to 158 F)\r\n Humidity: 10 - 95% RH, non-condensing\r\nHeat dissipation\r\n Standby power: 200 Watt / 720 kJ/h\r\n Average printing power: 450 Watt / 1620 kJ/h\r\n Peak power: 700 Watt / 2520 kJ/h\r\nSafety\r\n IEC 60601-1 + A1 + A2\r\n EN 60601-1 + A1 + A2\r\n UL 60601-1\r\n CSA 22.2 no. 601.1-M90\r\n GB 4943-2001', '10', 'modality', 'E-Catalogue', '2020-10-19 10:07:27', '2021-01-21 10:34:32');
