INSERT INTO `modalities` VALUES ('64', 'Computed Radiography (CR) System', 'Computed-Radiography-(CR)-System', 'CR 30-Xm', 'AGFA', '1250000000', 'Computed Radiography for General radiology and Mammography.\r\nSingle cassette feed	\r\nThroughput:	\r\n35 x 43 cm (14 x 17) = approx. 60 plates/hour	\r\n35 x 35 cm (14 x 14\") = approx. 60 plates/hour	\r\n24 x 30 cm (9.5 x 12) = approx. 71 plates/hour	\r\n18 x 24 cm (7 x 9.5) = approx. 76 plates/hour	\r\n15 x 30 cm (6 x 12) = approx. 82 plates/hour	\r\n24 x 30 cm mammo = approx. 32 plates/hour	\r\n18 x 24 cm mammo = approx. 38 plates/hour	\r\nDisplay	\r\n LED Status Indicator	\r\n Status and error messages on external PC monitor	\r\nGreyscale resolution	\r\n Data acquisition: 20 bits/pixel	\r\n Output to processor: 16 bits/pixel square root compressed	\r\n	\r\nConsisting of:	\r\nCR 30-Xm Digitizer	\r\nNX PC Workstation	\r\nStandard Quality wide Monitor 22\"	\r\nNX Premium EL	\r\nNX Optiview.	\r\nNX precision tool	\r\nNX QUALITY ASSURANCE	\r\nNX MUSICA 2	\r\nNX Mammo / Mixed use	\r\nCR MM 3.0T Mammo Set 18 x 24cm 	\r\nCR MD 4.0T General Set 35 x 43cm 	\r\nCR MD 4.0T General Set 24 x 30cm ', '0', 'modality', 'Non E-Catalogue', '2020-09-24 09:25:35', '2021-01-21 10:34:32');
INSERT INTO `modalities` VALUES ('65', 'Detector Digital Radiography (wireless) Retrofits', 'Detector-Digital-Radiography-(wireless)-Retrofits', 'DX-D 40-G', 'AGFA', '1525000000', 'Digital Detector with Automatic Exposure Detection (AED)		\r\nDETECTOR		\r\nDetector type		: Amorphous Silicon with TFT\r\nConversion screen		: Gadolinium Oxy-Sulphide (GOS)\r\nPixel pitch		: 140 m\r\nActive pixel matrix		: 2560 x 3072 pixels\r\nActive area size		: 358.4 mm x 430.1 mm\r\nEffective pixel matrix:		- GOS: 2560 x 3072\r\nEffective area:		- GOS: 358.4 mm x 430.1 mm\r\nGrayscale		: 14 bit\r\nSpacial Resolution		: Min. 3.5 lp/mm\r\nOuter dimensions:		384 mm  460 mm  15 mm (ISO 4090)\r\nWeight:		: 3.3 kg\r\nWireless data transmission:		IEEE 802.1111a/b/g/n, 2.4 GHz/5 GHz,\r\n		Energy Range Standard: 40  150 kVp\r\nBATTERY SPECIFICATIONS		\r\nType		: Lithium Ion Polymer Battery\r\nCapacity		: 4000 mAh\r\nNominal Voltage		: 7.4V\r\nCharging time		: 2 Hours\r\nOperation time:		4 hours (when sleep mode is off)\r\n		Cycle life: Approx. 500 cycles,\r\n		Capacity  80% (100% = 4,000 mAh)\r\nPower supply		Input: AC100 to 240V, 50/60 Hz, Max. 200VA\r\n		Output: DC +24V 3.3A, 80W\r\nCabling ports		Gigabit Ethernet Ports  3EA\r\n		Power over Ethernet Ports  2EA\r\n		Wireless communications:\r\n		IEEE 802.11a/b/g/n (2.4 GHz/5 GHz)\r\n		Dimensions (W  H  D):\r\n		300 mm  235.8 mm  58 mm,\r\n		Antenna height  105 mm\r\nConfigurations:		\r\nDX-D40 Detector set including detector,Charger,SCU&3 batteries.		\r\nNX8900 HP probook 650G1		\r\nNotebook USB to ethernet card		\r\nNX Instant DR genrad incld Musica2		\r\nNX DR Retrofit CR Licensed (integrare Agfa CR with a DX-D retrofit system).		\r\nNX precision tools		\r\n', '0', 'modality', 'Non E-Catalogue', '2020-09-24 09:29:14', '2021-01-21 10:34:32');
